DUE DATE IS WEDNESDAY, JULY 15, 2020: Click here to Complete Your Child's Re-Enrollment Packet (Returning Students ONLY GRADES 10-12)
Please visit the Nurse's Information page for all Physical Forms, Immunization, and Medication Questions
RETURNING STUDENTS ONLY
IF RE-ENROLLMENT PACKET IS NOT SUBMITTED BY THE DUE DATE OF WEDNESDAY, JULY 15, 2020, YOUR CHILD WILL NOT HAVE ACCESS TO THEIR SCHEDULE!
YOU WILL RECEIVE A VERIFICATION EMAIL WHEN THE BACK TO SCHOOL FORMS HAS BEEN VERIFIED.
Please click here to review important documents for the new school year.
June 2020
Dear Students and Parents/Guardians:
Welcome to the 
2020-2021 School Year!
  It will be a year of continued growth for our students and development for our educational community.
Reporting Schedule is tentative and subject to change based on guidance from the NJ Department of Education and local health officials. The Final Reporting Schedule will be released in August upon approval. Thank you for your understanding.
Full-time students will report to school as follows:
Wednesday, September 9th
:
Seniors - 10:00AM - 11:00AM
Live stream 
virtual orientation
Juniors - 12:00PM - 1:00PM 
Live stream 
virtual orientation
Thursday, September 10th
:
Sophomores - 10:00AM - 11:00AM  
Live stream 
virtual orientation
Freshman - 12:00PM - 1:00PM 
Live stream 
virtual orientation
Absences & Late Arrivals
Remember that any absence from school is to be reported each day to Ms. Salgado in the Attendance Office at 201-631-6333.
  Missing the regularly scheduled bus may constitute an unexcused tardy or absence.
Please avoid scheduling appointments for your child during the school day; schedule all appointments after school or on non-school days.  If an appointment is absolutely necessary, you must contact Ms. Salgado by phone or by letter.  This procedure will enable us to prepare the necessary forms so that your child can be signed out during the school day. Please direct your child to meet you at the Main Office at the designated time.
Tardiness will not be tolerated.  Unexcused lateness may result in an assigned detention from 7:30 – 8:30 AM on the following scheduled school day.  Continued lateness will result in a parental conference to determine the next course of action.
If a student becomes ill at school and needs to go home, the procedure is as follows: The parent/guardian goes to the Security Desk and is escorted to the Nurse's office to get the student.
Annual Notifications
HCST/County Prep High School is not responsible for lost, misplaced or stolen items including, but not limited to school books, cell phones, clothing, personal items, all electronic devices, etc.  It is your responsibility to secure your personal items in your assigned locker.  Do not share your locker or locker code with anyone.
In addition, we are required to notify you that the principal or designee may conduct a search of a student’s person or belongings if the search is necessary to maintain discipline and order in the school, and the school official has a reasonable suspicion that the student is concealing contraband. (N.J.A.C.6:3-6:1-6:6).
According to Public Law 2005, Chapter 266 (C.18A:35-4.24 & C.18A:35-4.25), students have the right to decline to dissect, vivisect, incubate, capture or otherwise harm or destroy animals or any parts thereof as part of a course of instruction. Within two weeks of receipt of this notice, the law requires parents or guardians to notify the school of their desire to have their child exempt from participation and provided with an alternative education project.  If you wish to have your child exempt from participation, please notify us in writing by September 18, 2020.
All students must have begun the Hepatitis B Vaccination process prior to the beginning of school.  All physical examination and vaccination forms must be submitted to our staff on the first day of attendance.  Students will not be allowed to begin school without the proper paperwork on file. 
Students, who are planning to participate in our Intramural or Dance Programs, must have an annual examination on file for this school year.  The completed physical examination will also be used to certify the physician’s section of student working papers.  The physical examination form was mailed to all students in June.
Mission Statement
We are a dynamic, diverse and compassionate learning community that encourages growth and embraces change through meaningful activities in a student centered environment.
“IT IS THE POLICY OF THE BOARD OF EDUCATION OF THE HUDSON COUNTY SCHOOLS OF TECHNOLOGY NOT TO DISCRIMINATE IN EMPLOYMENT OR EDUCATIONAL OPPORTUNITY AGAINST ANY PERSON BY REASON OF RACE, COLOR, NATIONAL ORIGIN, ANCESTRY, AGE, SEX, AFFECTIONAL OR SEXUAL ORIENTATION, MARITAL STATUS, LIABILITY FOR SERVICE IN THE ARMED FORCES OF THE UNITED STATES, OR ATYPICAL HEREDITARY CELLULAR OR BLOOD TRAIT OF ANY INDIVIDUAL, IN EMPLOYMENT OR IN EDUCATIONAL OPPORTUNITIES.  FURTHER STATE AND FEDERAL PROTECTION IS EXTENDED ON ACCOUNT OF DISABILITIES, SOCIAL OR ECONOMIC STATUS, PREGNANCY, CHILDBIRTH, PREGNANCY RELATED DISABILITIES, ACTUAL OR POTENTIAL PARENTHOOD, OR FAMILY STATUS.”  Inquiries regarding affirmative action, discrimination (including Title IX requirements), sexual harassment or equity should be directed to: Alicia Abraham, Affirmative Action Officer/504 Officer/Title IX Coordinator, Hudson County Schools of Technology, Earl W. Byrd Center, Explore Middle School, Frank J. Gargiulo Campus, One High Tech Way, Secaucus, NJ 07094, 201-662-6724 or Email: 
